script: |
  super -f text -I q5410.spq | sort > q5410.out

inputs:
  - name: q5410.spq
    data: |
      SELECT DISTINCT + cor1.col2 * 63 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q5410.out
    data: |
      2079
      5166
      63
